A queue implemented using two stacks is a basic queue data structure. The first stack is used for enqueuing (adding) elements, and the second stack is used for dequeuing (removing) elements.

```
# Python program to demonstrate queue using two stacks
# Python 3.7: a[0] is old, a[1] is new
# Python 3: a[0] is old, a[1] is new, a[2] is new, a[3] is old

class Queue:
    def __init__(self):
        self.s1 = []
        self.s2 = []

    def enqueue(self, x):
        # push element to stack 1
        self.s1.append(x)

    def dequeue(self):
        # if stack 1 is empty, move all elements from stack 2 to stack 1
        if not self.s2:
            while self.s1:
                self.s2.append(self.s1.pop())

        if self.s2:
            return self.s2.pop()
        else:
            return self.s1.pop()

    def is_empty(self):
        return not self.s1 and not self.s2

    def peek(self):
        if not self.s2:
            while self.s1:
                self.s2.append(self.s1.pop())
        return self.s1[-1] if self.s1 else None

    def size(self):
        return len(self.s1) + len(self.s2)


# Test code
q = Queue()
q.enqueue(1)
q.enqueue(2)
q.enqueue(3)
print(q.dequeue())  # Output: 1
q.enqueue(4)
print(q.dequeue())  # Output: 2
q.enqueue(5)
print(q.dequeue())  # Output: 3
print(q.is_empty())  # Output: True
print(q.dequeue())  # Output: 4
print(q.is_empty())  # Output: True
print(q.peek())  # Output: 5
print(q.dequeue())  # Output: 5
print(q.is_empty())  # Output: True
```

